const TItle = ({  picture,name, description, categories }) => {
    return (
        <>
            <div className="event__title">
                <div className="category">
                    {categories.map(data => <span id={`span_${data}`}> {data} </span>)}
                </div>
                <div className="title">{'Asiste al evento '+ name + ' revisa en este Link los detalles'}</div>
                <div className="org">{description}</div>
                {/*<!-- Go to www.addthis.com/dashboard to customize your tools -->*/}
                <div 
                data-title={name} 
                data-media={picture}
                class="addthis_inline_share_toolbox_3fk0"></div>


            </div>
        </>
    )
}

export { TItle }
